calculates.calculation:
(function() {
	var dobYear = data('dob_year');
	var dobMonth = data('dob_month') || 1;
	var dobDay = data('dob_day') || 1;
	var manualAge = data('dob_enter_age') || 0;

	if (!!dobYear) {
		var dob = new Date(dobYear, dobMonth - 1, dobDay);
		var now = new Date();

		return (now - dob) / 1000 / 60 / 60 / 24 / 365.25;
	} else {
		return manualAge;
	}
})()

(function() { return function(time) {
    return {
        'Before sunset': 0,
        'At sunset': 1,
        '1-2h after sunset': 2,
        '2-4h after sunset': 3,
        '>4h after sunset': 4
    }[time];
}})()

(function() { return function(time) {
    return {
        '>4h before sunrise': 0,
        '2-4h before sunrise': 1,
        '1-2h before sunrise': 2,
        'At sunrise': 3,
        'After sunrise': 4
    }[time];
}})()

(function() { return function(left, right, orderMapper) {
    return orderMapper(left) - orderMapper(right);
}})()

